import React from 'react';
import { Navigate, Outlet } from 'react-router-dom';

const PrivateRoute = () => {
  const isAuthenticated = localStorage.getItem('isAuthenticated') === 'true';  // check auth status

  return isAuthenticated ? <Outlet /> : <Navigate to="/login" />;  // Redirect if not authenticated
};

export default PrivateRoute;
